import React from "react";
import Styles from "./UI/styles.module.css";
import { IFormAddToDo } from "../../app/models/models";

export function FormAddToDoWindow(props:IFormAddToDo) {

	function handlerSubmit() {

	}

	return (
		<div className={Styles.container}>
			<form onSubmit={handlerSubmit} className={Styles.form} >
				<svg onClick={() => props.funcExitWindow()} role="button" aria-label="Кнопка закрыть форму авторизации" className={Styles.closeAuthForm} viewBox="0 0 12 12">
					<line x1="1" y1="11" x2="11" y2="1" stroke="#FF4D00" strokeWidth="1" />
					<line x1="1" y1="1" x2="11" y2="11" stroke="#FF4D00" strokeWidth="1" />
				</svg>
				<div className={Styles.inputContainer}>
					<label>Введите email: </label>
					<input placeholder="Ваш email" autoComplete="false" type="text" className={Styles.formAuthInput}/>
				</div>
				<div className={Styles.inputContainer}>
					<label>Введите пароль: </label>
					<input autoComplete="false" placeholder="Ваш пароль" type="password" className={Styles.formAuthInput}/>
				</div>
			</form>
		</div>
	);
}
